---Integer in range `[-32768, 32767]` that represents a 2D (xz plane) unit
---orientation.
---
---```
---                  F(N=2) = H(-32768 / 32767)
---
---                         ^
---                         |
---                         |
--- F(W=3) = H(-16384)  <---o--->  F(E=1) = H(16384)
---                         |
---                         |
---                         v
---
---                  F(S=0) = H(0)
---```
